import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import './App.css';
import DoctorsCategories from './components/DoctorsCategories';

const App = () => (
    <Router>
        <Route path='/' exact component={DoctorsCategories} />
    </Router>
);


export default App;
